import React from 'react'
import { Card, Image, Row, Col } from 'react-bootstrap'
import skillsData from '../../assets/skillsData.json'

const SkillsCard = () => {

   const DeploymentSkills = skillsData.filter(item=> item.category=== 'Deployment')

    return(
        <Card >
        <Row>
            <Card.Body >
                <Card.Title>
                    Deployment
                </Card.Title>
                <Card.Subtitle>
                    Services
                </Card.Subtitle>
                    {DeploymentSkills.map(item=>
                    <div style={styles.itemDiv}key={item.id}>
                      <Image src={require('../../assets/images/Icons'+ item.iconLogo)} style={styles.logo}/> 
                      <p>{item.name}</p>
                      </div>
                      )}

            </Card.Body>
        </Row>
        </Card>
    )

}

const styles = {
    itemDiv: {

    },
    logo: {
        height: '4em',
        width: '4em',
        color: 'white',
        margin: '0.4em'   
    }
}

export default SkillsCard;
